 // ==========this is for export from html to xls==============

 var date_theme = $("#date-theme").val();

 function HtmlTableToExcel(id) {
		
	 switch(date_theme)
	 {
	 case '1': bgColor =  '#4B77BE';break;
	 case '2': bgColor =  '#2980B9';break;
	 case '3': bgColor =  '#8E44AD';break;
	 case '4': bgColor =  '#26C281';break;
	 case '5': bgColor =  '#27AE60';break;
	 case '6': bgColor =  '#173E43';break;
	 case '7': bgColor =  '#E74C3C';break;
	 case '8': bgColor =  '#C0392B';break;
	 case '9': bgColor =  '#E67E22';break;
	 default : break;
	 }
	 
	    var tab_text = "<table border='2px'><tr bgColor='"+bgColor+"'>";
	    var textRange;
	    var j = 0;
	    tab = document.getElementById(id); // id of table
	    for (j = 0; j < tab.rows.length; j++) {
	        tab_text = tab_text + tab.rows[j].innerHTML + "</tr>";
	    }
	    tab_text = ReplaceAll(tab_text,"<td","<td style=mso-number-format:'\\@' ");
	    tab_text = tab_text + "</table>";
	    tab_text = tab_text.replace(/<A[^>]*>|<\/A>/g, "");
	    tab_text = tab_text.replace(/<img[^>]*>/gi, "");
	    tab_text = tab_text.replace(/<input[^>]*>|<\/input>/gi, "");

	    var ua = window.navigator.userAgent;
	    var msie = ua.indexOf("MSIE ");
	    if (msie > 0 || !!navigator.userAgent.match(/Trident.*rv\:11\./))
	    {
	        txtArea1.document.open("txt/html", "replace");
	        txtArea1.document.write(tab_text);
	        txtArea1.document.close();
	        txtArea1.focus();
	        sa = txtArea1.document.execCommand("SaveAs", true, "Say Thanks to Sumit.xls");
	    } else //other browser not tested on IE 11
	        sa = window.open('data:application/vnd.ms-excel,' + encodeURIComponent(tab_text));
	    return (sa);
	}
 //end of export method
 
 //for replace all
 function ReplaceAll(str, find, replace){
	 return str.replace(new RegExp(find,'g'),replace);
 }
 
