//Script for enabling popover to be able to copy the content
$(function(){
	$("[data-toggle='popover']").popover({
        html: true,
        trigger: 'manual',
        container: $(this).attr('id'),
        
    }).on("mouseenter", function () {
        var _this = this;
        $(this).popover("show");
        $(this).siblings(".popover").on("mouseleave", function () {
            $(_this).popover('hide');
        });
    }).on("mouseleave", function () {
        var _this = this;
        setTimeout(function () {
            if (!$(".popover:hover").length) {
                $(_this).popover("hide")
            }
        }, 100);
    });
});
